    public class BadgeClass
    {
        public readonly string Name;
        private readonly string Image;
        private readonly string Trainer;
        public readonly string TrainerName;
        private readonly string trainerModern;
        public System.Drawing.Image Badge
        {
            get { return this.Image.FromBase64(); }
        }
        public System.Drawing.Image TrainerRetro
        {
            get { return this.Trainer.FromBase64(); }
        }
        public System.Drawing.Image TrainerModern
        {
            get { return this.trainerModern.FromBase64(); }
        }
        internal BadgeClass(string name,string Image,string Trainer,string TrainerName,string Modern)
        {
            this.Name = name;
            this.Image = Image;
            this.Trainer = Trainer;
            this.TrainerName = TrainerName;
            this.trainerModern = Modern;
        }
